    false,nt"url": null,nt"notes": "This fact sheet examines trends in total
    reported irrigation water use and acres irrigated as well as irrigation water use
    by crop type and system type in Kansas for the years 1991 through 2011. During the
    21-year period, total reported irrigation water diversions varied substantially
    from year to year as affected primarily by climatic fluctuations. Total reported
    acres irrigated remained comparatively constant during this time, although acreages
    of irrigated corn increased and center pivots with drop nozzles became the dominant
    system type used for irrigation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
